import { TextField, Button } from '@mui/material';

function Form({ method }): React.FC<{ method: string }> {
  return (
    <form method={method}>
      <TextField label="wallet" name="wallet" />
      <TextField label="person" name="person" />
      <Button>Submit</Button>
    </form>
  );
}

export default Form;
